    //Dennna är faktiskt hyfsat bra
    public static boolean isIsomorphic3(String s, String t) {
        HashMap<Integer, Integer> mapS = new HashMap<>();
        HashMap<Integer, Integer> mapT = new HashMap<>();
        
        for(int i = 0; i < s.length(); i++){
            char charS = s.charAt(i);
            char charT = t.charAt(i);

            Integer a = mapS.put((int)charS, i);
            Integer b = mapT.put((int)charT, i);

            if(!(a == null || b == null)){
                if(!a.equals(b)){
                    return false;
                }
            }else if((a == null && b != null)|| (a != null && b == null) ){
                return false;
            }
            
        }

        return true;
    }


    //Inget att vara stolt över här heller när det kommer till tid eller minne men den blev accepterad
    public boolean isIsomorphic2(String s, String t) {
        
        String newS = s;
        String newT = t;

        for(int i = 0; i < s.length(); i++){
            char sChar = s.charAt(i);
            char tChar = t.charAt(i);

            if((newS.indexOf(sChar) != newT.indexOf(tChar)) || s.indexOf(sChar) != t.indexOf(tChar)){
                
                return false;
            }

            newS = newS.substring(1, newS.length());
            newT = newT.substring(1, newT.length());

        }

        return true;
    }

